Course.create({"id"=>1, "name"=>"Writing", "code"=>"1111", "image_url"=>"https://res.cloudinary.com/fergusdev/image/upload/v1591290485/subjects/writing_100x100_rbvmxk.png", "featured"=>true, "tuition_cost"=>0, "short_desc"=>"Short story writing.", "long_desc"=>"Shields up. I recommend we transfer power to phasers and arm the photon torpedoes. Something strange on the detector circuit. The weapons must have disrupted our communicators. You saw something as tasty as meat, but inorganically materialized out of patterns used by our transporters. Captain, the most elementary and valuable statement in science, the beginning of wisdom, is I do not know. All transporters off.", "created_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00", "updated_at"=>"Thu, 04 Jun 2020 19:17:13 UTC +00:00" })
Course.create({"id"=>2, "name"=>"Math", "code"=>"2222", "image_url"=>"https://res.cloudinary.com/fergusdev/image/upload/v1591290485/subjects/math_100x100_no9cxv.png", "featured"=>false, "tuition_cost"=>20, "short_desc"=>"Build fundamentals.", "long_desc"=>"Unidentified vessel travelling at sub warp speed, bearing 235.7. Fluctuations in energy readings from it, Captain. All transporters off. A strange set-up, but Id say the graviton generator is depolarized. The dark colourings of the scrapes are the leavings of natural rubber, a type of non-conductive sole used by researchers experimenting with electricity. The molecules must have been partly de-phased by the anyon beam.", "created_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00", "updated_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00" })
Course.create({"id"=>3, "name"=>"Physics", "code"=>"3333", "image_url"=>"https://res.cloudinary.com/fergusdev/image/upload/v1591290485/subjects/physics_100x100_ktftri.png", "featured"=>false, "tuition_cost"=>0, "short_desc"=>"Matter and energy.", "long_desc"=>"Now what are the possibilities of warp drive? Cmdr Rikers nervous system has been invaded by an unknown microorganism. The organisms fuse to the nerve, intertwining at the molecular level. Thats why the transporters biofilters couldnt extract it. The vertex waves show a K-complex corresponding to an REM state. The engineering sections critical. Destruction is imminent. Their robes contain ultritium, highly explosive, virtually undetectable by your transporter.", "created_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00", "updated_at"=>"Thu, 04 Jun 2020 19:17:41 UTC +00:00" })
Course.create({"id"=>4, "name"=>"Music", "code"=>"4444", "image_url"=>"https://res.cloudinary.com/fergusdev/image/upload/v1591290485/subjects/music_100x100_hhayfx.png", "featured"=>true, "tuition_cost"=>30, "short_desc"=>"Learn to read music.", "long_desc"=>"Run a manual sweep of anomalous airborne or electromagnetic readings. Radiation levels in our atmosphere have increased by 3,000 percent. Electromagnetic and subspace wave fronts approaching synchronization. What is the strength of the ships deflector shields at maximum output? The wormholes size and short period would make this a local phenomenon. Do you have sufficient data to compile a holographic simulation?", "created_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00", "updated_at"=>"Thu, 04 Jun 2020 19:17:56 UTC +00:00" })
Course.create({"id"=>6, "name"=>"Physical Education", "code"=>"5555", "image_url"=>"https://res.cloudinary.com/fergusdev/image/upload/v1591290485/subjects/physical_education_100x100_hrsysi.png", "featured"=>false, "tuition_cost"=>0, "short_desc"=>"Get fit and play sports. ", "long_desc"=>"Zombie ipsum reversus ab viral inferno, nam rick grimes malum cerebro. De carne lumbering animata corpora quaeritis. Summus brains sit​​, morbo vel maleficia? De apocalypsi gorger omero undead survivor dictum mauris. Hi mindless mortuis soulless creaturas, imo evil stalking monstra adventus resi dentevil vultus comedat cerebella viventium. Qui animated corpse, cricket bat max brucks terribilem incessu zomby. The voodoo sacerdos flesh eater, suscitat mortuos comedere carnem virus. Zonbi tattered for solum oculi eorum defunctis go lum cerebro. Nescio brains an Undead zombies. Sicut malus putrid voodoo horror. Nigh tofth eliv ingdead.", "created_at"=>"Fri, 29 May 2020 00:11:25 UTC +00:00", "updated_at"=>"Thu, 04 Jun 2020 17:35:30 UTC +00:00" })
Course.create({"id"=>7, "name"=>"Theater", "code"=>"6666", "image_url"=>"https://res.cloudinary.com/fergusdev/image/upload/v1591290485/subjects/theater_100x100_vfopz7.png", "featured"=>false, "tuition_cost"=>0, "short_desc"=>"Learn method acting.", "long_desc"=>"In painting, you have unlimited power. You have the ability to move mountains. All you need to paint is a few tools, a little instruction, and a vision in your mind. Just use the old one inch brush. They say everything looks better with odd numbers of things. But sometimes I put even numbers—just to upset the critics. Nothing wrong with washing your brush. The least little bit can do so much.", "created_at"=>"Fri, 29 May 2020 00:11:25 UTC +00:00", "updated_at"=>"Thu, 04 Jun 2020 19:18:21 UTC +00:00" })
